package org.pivxj.bp.impl;

import java.util.ArrayList;
import java.util.List;

import org.pivxj.core.ECKey;
import org.pivxj.core.Utils;
import org.pivxj.crypto.LazyECPoint;

public class Generators {
	public static List<LazyECPoint> generateGeneratorsVector(int num) {
		List<LazyECPoint> ret = new ArrayList<LazyECPoint>();
		byte[] bs = Utils.HEX.decode("");
		int numPoints = bs.length/64;
		for(int i = 0; i < numPoints; i++) {
			byte[] data = new byte[65];
			data[0] = (byte)4;
			System.arraycopy(bs, i * 64, data, 1, 64);
			LazyECPoint newPoint = new LazyECPoint(ECKey.CURVE.getCurve(), data);
			ret.add(newPoint);
		}
		return ret;
	}
}
